let parts = [process.platform, process.arch];
// Only GNU system has this field
if (process.platform === 'linux') {
  if (process.arch === 'arm') {
    parts.push('gnueabihf');
  } else if (false) {
    parts.push('musl');
  } else {
    parts.push('gnu');
  }
} else if (process.platform === 'win32') {
  parts.push('msvc');
}

module.exports = require(`./artifacts/index.${parts.join('-')}.node`);
